import { GET_CONSTITUENCY_CANDIDATES } from "../actions/types"



export default function constituencyCandidateReducer(state={}, action) {
    switch(action.type) {
        case GET_CONSTITUENCY_CANDIDATES:
            return action.payload
        default:
            return state
    }
}
